import React, { useState, useEffect } from 'react';

export default function Test() {
  const [textPromptback, setPromptback] = useState('hello');

  useEffect(() => {
    fetch('/api')
      .then((response) => response.json())
      .then((data) => {
        console.log(data)
        setPromptback(data);
      })
      .catch((error) => {
        console.error('Error fetching prompt:', error);
      });
  }, []);

  return (
    <div>
      {textPromptback}
    </div>
  );
}
